Sure! Here's a JavaScript function that switches the order of adjectives in a sentence:

```javascript
function switchAdjectives(sentence) {
  // Split the sentence into an array of words
  const words = sentence.split(' ');

  // Find the index of the first adjective (word that is not "the")
  let adjectiveIndex = -1;
  for (let I = 0; I < words.length; i++) {
    if (words[i] !== 'the' && /^[a-z]+$/.test(words[i])) {
      adjectiveIndex = i;
      break;
    }
  }

  // If no adjectives found, return the original sentence
  if (adjectiveIndex === -1) {
    return sentence;
  }

  // Swap the positions of the first and second adjectives
  const [firstAdj, ...rest] = words.slice(0, adjectiveIndex + 2);
  const reversedRest = rest.reverse();
  const reversedSentence = [...reversedRest, firstAdj].join(' ');

  // Combine the reversed adjectives with the remaining words
  return `${reversedSentence} ${sentence.slice(adjectiveIndex + 2).join(' ')}`.trim();
}

// Example usage
const originalSentence = "Beautiful green trees are in the park";
const modifiedSentence = switchAdjectives(originalSentence);
console.log(modifiedSentence); // Output: "Green beautiful trees are in the park"
```

This function works by splitting the input sentence into an array of words, finding the indices of the first two adjectives, reversing the order of the remaining words between them, and then joining everything back together. The `slice()`, `reverse()`, and `join()` methods are used to manipulate the arrays, and `...` spread syntax is used to combine multiple arrays into one. The `trim()` method is called at the end to remove any trailing whitespace from the final string.

