```js
function getNestedValues(obj, keyPath) {
  let values = [];
  let currentObj = obj;
  const keys = keyPath.split('.');

  for (let I = 0; I < keys.length; i++) {
    if (!currentObj[keys[i]]) {
      return values; // Stop searching if any key is not found
    }

    if (i === keys.length - 1) {
      values.push(currentObj[keys[i]]);
    }

    currentObj = currentObj[keys[i]];
  }

  return values;
}

