function shuffle(arr, randomize) {
  const result = [];

  for (let I = 0; I < arr.length; i++) {
    let position = arr[i].position - 1;

    // If randomization is enabled, randomly choose a position
    if (randomize && Math.random() > 0.5) {
      const swappedPosition = Math.floor(Math.random() * result.length);

      [result[position], result[swappedPosition]] = [result[swappedPosition], result[position]];
      position = swappedPosition;
    }

    result[position] = arr[i];
  }

  return result;
}

