```c
#include <stdlib.h>
#include <string.h>

char *join_args(int argc, char **argv) {
    size_t len = 0;
    for (int I = 0; I < argc; i++) {
        len += strlen(argv[i]) + 1; // add space between args and null terminator
    }
    char *result = malloc(len);
    int pos = 0;
    for (int I = 0; I < argc; i++) {
        strcpy(result + pos, argv[i]);
        pos += strlen(argv[i]);
        if (i != argc - 1) {
            result[pos++] = ' ';
        }
    }
    result[pos] = '\0';
    return result;
}

int main(int argc, char **argv) {
    char *joined = join_args(argc, argv);
    printf("Joined: %s\n", joined);
    free(joined);
    return 0;
}
```

This function takes `argc` and `argv` as input and returns a new string that contains all command-line arguments concatenated with spaces in between. The function uses dynamic memory allocation to create a new string large enough to hold all the arguments and their separators. The original `argv` array is not modified.

The function also includes a simple `main()` function to test it. You can replace this `main()` function with your own usage of `join_args()`.

