```typescript
import { Injectable } from '@nestjs/common';
import { ExecutionContext, NestFactory, UnauthorizedException } from '@nestjs/core';
import { Observable } from 'rxjs';

@Injectable()
export class EnvironmentGuard implements CanActivate {
  canActivate(context: ExecutionContext): boolean | Promise<boolean> | Observable<boolean> {
    const request = context.switchToHttp().getRequest();
    const app = context.switchToNest().getNestApplication();
    const isDevMode = app.get(NestFactory).getLogger('app').isDev();

    if (request.headers['x-forwarded-proto'] === 'https' && process.env.NODE_ENV !== 'production') {
      request.headers['x-forwarded-ssl'] = 'true';
    }

    const env = process.env.NODE_ENV;

    if (env === 'development' || env === 'test' || isDevMode) {
      return super.canActivate(context);
    } else {
      throw new UnauthorizedException({ message: 'Unauthorized' });
    }
  }
}

export function IsProduction() {
  return createMiddleware((req, res, next) => {
    const env = process.env.NODE_ENV;

    if (env === 'production') {
      return super.invoke(req, res, next);
    }

    return false;
  });
}

function createMiddleware(fn: Function) {
  return (target: Object, propertyKey: string | symbol) => {
    const originalMethod = target[propertyKey];

    Reflect.defineMetadata('middleware', fn, target, propertyKey);

    target[propertyKey] = function (...args: any[]) {
      const context = this;
      return Reflect.apply(originalMethod, context, args).pipe(
        tap(() => {
          fn(context.req, context.res, context.next);
        }),
      );
    };
  };
}

