```js
function sortAsc(arr) {
  return arr.sort((a, b) => {
    // The arrow function takes two parameters 'a' and 'b' representing the elements being compared.
    // Here we're returning the difference between them as the sorting key, with negative sign for descending order.
    // Since we want ascending order, we're returning it with positive sign.
    return a - b;
  });
}

