```go
func hasDoubleNegation(sentence string) bool {
    // Split the sentence into words
    words := strings.Split(sentence, " ")

    // Keep track of the last encountered negative word
    lastNegWord := ""

    // Iterate over each word in the sentence
    for _, word := range words {
        // Check if the current word is a negative word
        if negWords[word] || (lastNegWord != "" && negWords[lastNegWord]) {
            // If we encounter another negative word after a previous one,
            // return true as we have found a double negative
            return true
        }
        // Update the last encountered negative word
        lastNegWord = word
    }

    // If we reach here, no double negative was found
    return false
}
